import React from 'react'
import { NavLink } from 'react-router-dom'

function SideBar(props) {
    return (
        <div className="sidebar">
            <NavLink to="/login">Login</NavLink>
            <NavLink to="/Signup">Signup</NavLink>
        </div>
    )
}

export default SideBar
